import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";


export class LensAdvanced extends Component{
    render(){
        return(
            <div>
                <Row style={{ fontFamily: "Arial Black" }}>
                    <Col>Right Eye</Col>
                    <Col></Col>
                    <Col>Left Eye</Col>
                </Row>
                <hr></hr>
            </div>
        )
    }
}
